import logo from './logo.svg';
import './App.css';
import React, { useEffect, useState } from 'react';
import axios from 'axios'

function App() {

  const [getMessage, setGetMessage] = useState({})

  useEffect(() => {
    axios.get('https://shepfoodfinder.herokuapp.com/flask/hello').then(response => {
      console.log("SUCCESS", response)
      setGetMessage(response)
    }).catch(error => {
      console.log(error)
    })

  }, [])


  return (
    <div>
      <div class="welcome">
        <h1>What should we have for dinner?</h1>



      </div>

      <div class="foodChoice" id="givenfooditem">


      </div>

      <div class="button">
        <button id="btn">Pick a food</button>
        <button id="addbtn">Add a food</button>
      </div>
      <script src="https://unpkg.com/react@18/umd/react.development.js" crossorigin></script>
      <script src="https://unpkg.com/react-dom@18/umd/react-dom.development.js" crossorigin></script>
      <script src="/javascript/search-btn.js"></script>
    </div>
  );
}

export default App;
